import React from 'react'
import { useEffect, useState } from 'react';

function ArticleList(articles) {
    return (
        <div>
            {
                articles.map(article => {
                    return (
                        <div key={article.id}>
                            <h2>{article.title}</h2>
                            <p>{article.body}</p>
                            <p>{article.date}</p>
                        </div>
                    )
                })
            }
        </div>
    )
}

export default ArticleList
